import React from 'react'

function Signin() {
  return (
    <div>
      <center></center><label>Enter Admin Email:</label>
      <input type='email'></input>
      
      <label>Enter Password:</label>
      <input type='password'></input>
      
    </div>
  )
}

export default Signin
